BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Cliente" (
	"IDCliente"	INTEGER,
	"Domicilio"	TEXT NOT NULL,
	"Telefono"	INTEGER NOT NULL,
	"Nombre"	TEXT NOT NULL,
	PRIMARY KEY("IDCliente" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "DetalleV" (
	"IDDetalle"	INTEGER,
	"IDProducto"	INTEGER NOT NULL,
	"IDVenta"	INTEGER NOT NULL,
	"Costo"	INTEGER NOT NULL,
	"Cantidad"	INTEGER NOT NULL,
	"Importe"	INTEGER NOT NULL,
	PRIMARY KEY("IDDetalle" AUTOINCREMENT),
	FOREIGN KEY("IDVenta") REFERENCES "Venta"("IDVenta"),
	FOREIGN KEY("IDProducto") REFERENCES "Producto"("IDProducto")
);
CREATE TABLE IF NOT EXISTS "Venta" (
	"IDVenta"	INTEGER,
	"IDCliente"	INTEGER NOT NULL,
	"IDEmpleado"	INTEGER NOT NULL,
	"Lugar"	TEXT NOT NULL,
	"Fecha"	INTEGER NOT NULL,
	"Monto"	INTEGER NOT NULL,
	"NoPedido"	INTEGER NOT NULL,
	PRIMARY KEY("IDVenta" AUTOINCREMENT),
	FOREIGN KEY("IDCliente") REFERENCES "Cliente"("IDCliente"),
	FOREIGN KEY("IDEmpleado") REFERENCES "Empleado"("IDEmpleado")
);
CREATE TABLE IF NOT EXISTS "Inventario" (
	"IDInventario"	INTEGER,
	"IDProducto"	INTEGER NOT NULL,
	"Fecha"	INTEGER NOT NULL,
	"Cantidad"	INTEGER NOT NULL,
	"TipoDeMovimiento"	TEXT NOT NULL,
	PRIMARY KEY("IDInventario" AUTOINCREMENT),
	FOREIGN KEY("IDProducto") REFERENCES "Producto"("IDProducto")
);
CREATE TABLE IF NOT EXISTS "Empleado" (
	"IDEmpleado"	INTEGER,
	"Nombre"	TEXT NOT NULL,
	"Telefono"	INTEGER NOT NULL,
	"Domicilio"	TEXT NOT NULL,
	"Puesto"	TEXT NOT NULL,
	"password"	TEXT NOT NULL,
	PRIMARY KEY("IDEmpleado" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Producto" (
	"IDProducto"	INTEGER,
	"IDProveedor"	INTEGER NOT NULL,
	"Codigo"	INTEGER NOT NULL,
	"Precio"	REAL NOT NULL,
	"PrecioVenta"	REAL NOT NULL,
	"Descripcion"	TEXT NOT NULL,
	PRIMARY KEY("IDProducto" AUTOINCREMENT),
	FOREIGN KEY("IDProveedor") REFERENCES "Proveedor"("IDProveedor")
);
CREATE TABLE IF NOT EXISTS "Proveedor" (
	"IDProveedor"	INTEGER,
	"NombreProveedor"	TEXT NOT NULL,
	"Contacto"	INTEGER NOT NULL,
	"descripcion"	TEXT NOT NULL,
	PRIMARY KEY("IDProveedor" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Autos" (
	"idauto"	INTEGER,
	"marca"	TEXT NOT NULL,
	"a√±o"	INTEGER NOT NULL,
	"tipodeauto"	TEXT NOT NULL,
	"cilindros"	TEXT NOT NULL,
	"imagen"	TEXT NOT NULL,
	PRIMARY KEY("idauto" AUTOINCREMENT)
);
